entry.value:
import groovy.json.JsonSlurper
import org.apache.nifi.processor.io.StreamCallback

def flowFile = session.get()
if (flowFile == null) return

// Ly gi tr t attribute v_list_col (dng JSON array: ["A","B","C"])
def vTestValue = flowFile.getAttribute('v_list_col')
if (vTestValue) {
    def jsonSlurper = new JsonSlurper()
    def columnArray = jsonSlurper.parseText(vTestValue) // List<String>

    // 1. Danh sch ct gc vi du ngoc kp: "A","B","C"
    def columnString = columnArray.collect { "\"${it}\"" }.join(',')

    // 2. Danh sch cho INSERT target: ("A","B","C")
    def v_list_col_ins_tar = columnString

    // 3. Danh sch cho INSERT source: (S."A",S."B",S."C")
    def v_list_col_ins_src = columnArray.collect { "S.\"${it}\"" }.join(',')

    // 4. Danh sch cho UPDATE set: "A"=S."A","B"=S."B","C"=S."C"
    def v_list_col_upd = columnArray.collect { "\"${it}\"=S.\"${it}\"" }.join(',')

    // 5. Danh sch cho SELECT: tt c ct tr OP_NO, LOAD_DATE, LOAD_TIME (c du ngoc kp)
    def excludeColumns = ['OP_NO', 'LOAD_DATE', 'LOAD_TIME']
    def v_list_col_sel = columnArray.findAll { !excludeColumns.contains(it) }.collect { "\"${it}\"" }.join(',')

    // Lu vo attribute  dng trong cu MERGE
    flowFile = session.putAttribute(flowFile, 'column_list', columnString)
    flowFile = session.putAttribute(flowFile, 'v_list_col_ins_tar', v_list_col_ins_tar)
    flowFile = session.putAttribute(flowFile, 'v_list_col_ins_src', v_list_col_ins_src)
    flowFile = session.putAttribute(flowFile, 'v_list_col_upd', v_list_col_upd)
    flowFile = session.putAttribute(flowFile, 'v_list_col_sel', v_list_col_sel)

    // Nu bn vn mun ghi ni dung file = column_list
    flowFile = session.write(flowFile, { inputStream, outputStream ->
        outputStream.write(columnString.getBytes("UTF-8"))
    } as StreamCallback)
}

session.transfer(flowFile, REL_SUCCESS)

select ora_rowscn OP_NO, to_date('${v_current_date}','yyyymmdd') AS LOAD_DATE, cast(SYSTIMESTAMP as timestamp(6)) AS LOAD_TIME,
${v_list_col_sel}
from ${src_schema}.${src_table} a where ora_rowscn > ${max_scn} and ora_rowscn <= ${new_max_src_scn}

select ora_rowscn OP_NO, to_date('${v_current_date}','yyyymmdd') AS LOAD_DATE, cast(SYSTIMESTAMP as timestamp(6)) AS LOAD_TIME,
${v_list_col_sel}
from ${src_schema}.${src_table} a where ora_rowscn > ${max_scn} and ora_rowscn <= ${new_max_src_scn}

MERGE into lakehouse.${integration_schema}.${integration_table}  t
USING ( 
        select * 
        from  lakehouse.${landing_schema}.${landing_table} a  where op_no >= ${max_scn}
        QUALIFY ROW_NUMBER() OVER (
            PARTITION BY ${src_key_name}
            ORDER BY op_no desc
          ) = 1 ) s 
on  t.${src_key_name}= s.${src_key_name}
when MATCHED THEN UPDATE SET  ${v_list_col_upd}
WHEN NOT MATCHED THEN INSERT (${v_list_col_ins_tar}) values (${v_list_col_ins_src})
